int lookup_element_vr(int grpid, int elid)
{
  int lo, hi, mi;
  unsigned int id = (grpid << 16) + elid;
  
  lo = 0;
  hi = sizeof(dicom_tags) / sizeof(dicom_tags[0]) - 1;

  while (lo <= hi) {
    mi = (lo + hi) / 2;
    if (id < dicom_tags[mi].id) {
      hi = mi - 1;
    }
    else if (id > dicom_tags[mi].id) {
      lo = mi + 1;
    }
    else {
      return dicom_tags[mi].vr;
    }
  }
  return ACR_VR_UNKNOWN;
}

